import React from 'react';
import LandingPage from "./page/landingPage";
import {Switch,Route} from 'react-router-dom'
import ProjectPage from "./page/ProjectPage";


function App() {
  return (
      <main>
          <LandingPage/>
          <Switch>
              <Route path="/projects" component={<ProjectPage/>} />
          </Switch>
      </main>



  );
}

export default App;
